import LanguageItem from "../components/languageItem"

import React, { Component } from 'react'



class language extends Component {

    state = {
        languages : [
            {
                id: 1,
                icon : "fab fa-html5",
                text : "HTML5"
            }, 
            {
                id: 2,
                icon : "fab fa-css3",
                text : "CSS3"
            },
            {
                id: 3,
                icon : "fab fa-js",
                text : "JavaScript"
            },
            {
                id: 4,
                icon : "fab fa-react",
                text : "ReactJS"
            },
            {
                id: 5,
                icon : "fab fa-php",
                text : "PHP"
            },
            {
                id: 6,
                icon : "fab fa-sass",
                text : "SASS"
            }
         ]
    }

    render() {
        const {languages} = this.state;
        return (
            <div className="language">
            {
                languages.map(item =>
                <LanguageItem key={item.id} value={item}></LanguageItem>
                )
            }
        </div>
        )
    }
}

export default language;



